import React from "react"
import AllGroups from "./AllGroups"
import Title from "./Title"
import {NavLink} from "react-router-dom";
import GroupColumns from "./GroupColumns"
import EmptyNetwork from "./EmptyNetwork"
import {MemberConsumer} from "./Context"
import MembersList from "./MembersList"
import styled from 'styled-components';

function GroupMembers () {
	return(

	<MemberConsumer>
		{value  =>{
      	const {id, name, img, about,profession,menteepower, location, inNetwork}=
      	value.MemberDetail;

      	return(



         value =>{
         	const {MyNetworkMentees} = value;
         	if(MyNetworkMentees.length>0 ){
         		return(
         		<React.Fragment>
         			<Title title="My mentees" />

      				<MembersList value={value}/>
      			</React.Fragment>
         		);
         	}else{
         		return  <EmptyNetwork />;
         	}
         	},


 	inNetwork?(
      			<NavLink to = "/mynetworkmentees">
      			<p className="text-capitalize mb-0" disabled>
      			{" "}
      			in my Network
      			</p></NavLink>
      			):(
      			<i className="fas fa-plus" />
						)

         	)}}
         </MemberConsumer>

    )
  }


export default GroupMembers


const TabContainer = styled.div``
